export const chk = (value, test) => {
    let condition = false;
    if (value === test) {
        condition = true;
    }
    return condition;
}
export const food = [
    'White Rice',
    'Fried Rice',
    'Jollof Rice',
    'Mixed Rice',
    'Porridge Beans',
    'Bread 350',
    'Bread 500'

]
function Top(name, price, number) {
    this.name = name;
    this.price = price * this.number;
    this.number = number;
}
export const chn = (sign, by) => {
    switch (sign) {
        case "+":
        case "-":
        default:
            break;
    }
}
